import React from "react";
import { socials } from "../../data/social";
import { images } from "../../data/images";

const currentYear = new Date().getFullYear();

export const Footer = () => {
  return (
    <div className="mt-32 md:px-8 xl:px-20">
      <div className="flex">
        <div className="w-1/2">
          {images.map((i) => (
            <img
              src={`assets/${i}`}
              alt="img"
              className="rounded-full md:h-20 md:w-20 xl:h-24 xl:w-24 xl:mx-3"
            />
          ))}
        </div>
        <div className="xl:w-1/2 xl:flex xl:justify-center">
          <ul>
            {socials.map((s) => (
              <li className="links xl:text-xl">
                <a href={s.link}>{s.title}</a>
              </li>
            ))}
          </ul>
        </div>
      </div>
      <div className="xl:flex xl:justify-center xl:mt-20">
        <h1 className="year">{currentYear}</h1>
      </div>
    </div>
  );
};
